<h3><strong>RUTINA 2: PUSH &ndash; PULL &ndash; LEGS</strong></h3>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:"Calibri",sans-serif;'>Esta rutina para tres d&iacute;as de gimnasio, es la hermana peque&ntilde;a de la Pull &ndash; Push &ndash; Legs de 6 d&iacute;as para gente con mucho tiempo para entrenar y con buen descanso. Como es habitual en este tipo de divisiones, se priorizan ejercicios multiarticulares para optimizar cada serie que hagamos en el gimnasio. En este caso, la rutina se divide en un entrenamiento de empuj&oacute;n (push) en el que hacemos patrones de movimiento en los que alejamos el peso de nosotros (press banca, press militar, press franc&eacute;s&hellip;), otro entrenamiento de tir&oacute;n (pull) en el que atraemos el peso hacia nosotros (remo, facepull, dominadas&hellip;) y un d&iacute;a de pierna en el que trabajamos ambos patrones de movimiento.</p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:"Calibri",sans-serif;'>Esta rutina es muy interesante para gente que combina el gimnasio con otros deportes, ya que le permite organizar su d&iacute;a de pierna convenientemente seg&uacute;n tenga su descanso estipulado. Como siempre, recomendamos dejar un d&iacute;a de descanso activo entre sesi&oacute;n de entrenamiento, ya que cada vez que visitemos el gimnasio ser&aacute; bastante demandante.</p>
