<h3><strong>RUTINA 3: TORSO &ndash; PIERNA &ndash; FULLBODY</strong></h3>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:"Calibri",sans-serif;'>Esta rutina de gimnasio para tres d&iacute;as es una variaci&oacute;n de la anterior en la que damos m&aacute;s peso al tren inferior. Al final, nuestras piernas son casi el 50% de nuestra masa muscular, as&iacute; que tiene sentido darle aproximadamente la mitad de nuestro entrenamiento. Este entrenamiento es muy interesante para obtener un f&iacute;sico balanceado y hace bastante hincapi&eacute; en la fuerza, ya que el tercer d&iacute;a es exclusivamente un entrenamiento de b&aacute;sicos.</p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:"Calibri",sans-serif;'>Tal vez el &uacute;nico problema podr&iacute;a ser que entrenar tanta fuerza puede interferir en otros objetivos deportivos, por lo que esta rutina es ideal para personas que quieran progresar en fuerza, est&eacute;tica y no tengan demasiado tiempo.</p>
